Marco Borsato`s Concert Wit Licht 2008  

De vele duizenden in het wit gehulde fans genoten van een spetterende show, 
waarin bekende nummers zoals, Vrij Zijn, Margherita, Je Hoeft Niet Naar Huis, Dromen Zijn Bedrog, Binnen, 
Afscheid Nemen Bestaat Niet en Waarom Nou Jij voorbij kwamen. 
Gueststar en Herman Brood-vertolker (in de film :Wild Romance) Daniel Boissevain coverde Saturday Night en Paul Carrack, een idool van Marco, bracht Dedicated en Over My Shoulder ten gehore. 
De show bouwde op naar een spraakmakende climax, waarin Borsato over het publiek vloog, 
gedragen door wit licht en de tonen van zijn hit Wit Licht.



